COVID-19 has barred pretty much all activities for both but today is St. Patrick's Day for some, it is also Nai Khanomtom Day in Thailand. On this day we recognize the Thai folk hero and person widely considered the father of modern Muay Thai,  Nai Khanomtom. Legend has it that following a battle during which he was captured, Nai Khanomtom was forced to fight for the pleasure of the invading king. During these fights Nai Khanomtom defeated 10 opposing warriors consecutively. The enemy King was so impressed with his victories that he granted Nai Khanomtom his freedom (among other things). With that, I wish all practitioners of Muay Thai the best of luck in your lives. May you fight with the strength of ten men.

